import React from "react";
import './Home.css';
import { Container, Row, Col } from "../../components/Grid";
// import SearchBar from "../../components/SearchBar";

function Home() {

    return (
      <Container fluid>
        <Container>
          <Col size="size md-12">
            <h1 id="header">FIND A BUSINESS </h1>
            <p id="search"> Search </p>
            <p id="search"> ------INSERT SEARCH BAR HERE------ </p>
          </Col>
          {/* <SearchBar /> */}
        </Container>

        <Container>
          <Col size="size md-12">
            <h2 class="subheader" id="subheader1">HOW IT WORKS </h2>
            <br></br>
          </Col>
        </Container>

        <Container>
          <Col size="size md-12">
            <h2 class="subheader" >SUGGESTED CATEGORIES </h2>
            <br></br>
          </Col>
        </Container>

        <Container >
          <Col size="size md-12">
            <h2 class="subheader" >REGISTER YOUR BUSINESS </h2>
            <button id="registerbtn" type="submit" className="btn btn-primary">Sign up now</button>
            <br></br>
          </Col>
        </Container>





      </Container>
      );
    }


export default Home;
